import styles from './Navbar.module.scss';
import { Navbar } from 'react-bootstrap';

const NavBar = () => {
  return (
    <NavBar className={styles.navbar}>
      <div className={styles.logo}>Logo</div>
    </NavBar>
  );
};

export default NavBar;
